import { useState } from "react";
import { motion } from "framer-motion";

function App() {
  const [url, setUrl] = useState("");
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [scanMessage, setScanMessage] = useState("Scanning…");

  // Messages that rotate during scan
  const scanMessages = [
    "Scanning…",
    "Checking URL structure…",
    "Analyzing patterns…",
    "Validating request…",
    "Inspecting entropy…",
    "Checking URL signature…",
  ];

  // Make text cycle during loading
  const cycleMessages = () => {
    let index = 0;
    const interval = setInterval(() => {
      setScanMessage(scanMessages[index % scanMessages.length]);
      index++;
    }, 800);

    return interval;
  };

  const scanUrl = async () => {
    if (!url.trim()) return;

    setLoading(true);
    setResult(null);

    const interval = cycleMessages(); // start text cycle

    try {
      const res = await fetch("http://127.0.0.1:8000/predict", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ url }),
      });

      const data = await res.json();

      // 3-second artificial delay for realism
      setTimeout(() => {
        clearInterval(interval);
        setResult(data);
        setLoading(false);
      }, 3000);

    } catch (error) {
      console.error(error);
      clearInterval(interval);
      setLoading(false);
    }
  };

  // UI Confidence FIX — shows safeness confidence for SAFE urls
  const getConfidence = () => {
    if (!result) return 0;
    return result.prediction === "phishing"
      ? result.confidence * 100
      : (1 - result.confidence) * 100;
  };

  // Frontend-only risk logic
  const getRiskLevel = () => {
    const c = result.confidence;
    if (c < 0.20) return "Low Risk";
    if (c < 0.65) return "Medium Risk";
    return "High Risk";
  };

  return (
    <div className="min-h-screen bg-gradient-to-b from-black via-slate-950 to-black text-slate-100 flex items-center justify-center px-4 relative overflow-hidden">

      {/* MAIN CONTAINER */}
      <div className="w-full max-w-2xl relative z-10">

        {/* TITLE */}
        <h1 className="text-4xl font-extrabold mb-4 text-center">
          <span className="text-emerald-400">AI</span> Phishing URL Detector
        </h1>

        <p className="text-slate-400 text-center mb-10">
          Paste a URL below and let the model analyze it in real time.
        </p>

        {/* INPUT + BUTTON */}
        <div className="flex gap-3 mb-8">
          <input
            value={url}
            onChange={(e) => setUrl(e.target.value)}
            placeholder="Enter URL…"
            className="flex-1 px-4 py-3 rounded-lg bg-slate-900/60 border border-slate-700 text-slate-200 
                       focus:outline-none focus:border-emerald-400 focus:ring-4 focus:ring-emerald-500/20
                       transition-all duration-300 backdrop-blur-xl"
          />

          <button
            onClick={scanUrl}
            disabled={loading}
            className="px-6 py-3 rounded-lg bg-emerald-500 hover:bg-emerald-600 disabled:bg-slate-600 
                       text-black font-bold transition"
          >
            {loading ? "Scanning…" : "Scan"}
          </button>
        </div>

        {/* SCANNING OVERLAY */}
        {loading && (
          <div className="flex flex-col items-center mt-10">
            
            {/* Spinner */}
            <div className="w-20 h-20 border-4 border-emerald-400 border-t-transparent rounded-full animate-spin mb-5"></div>

            {/* Animated text */}
            <motion.p
              key={scanMessage}
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ duration: 0.4 }}
              className="text-slate-400 text-lg"
            >
              {scanMessage}
            </motion.p>
          </div>
        )}

        {/* RESULT CARD */}
        {result && !loading && result.prediction !== "error" && (
          <motion.div
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5 }}
            className={`mt-6 p-6 rounded-xl border backdrop-blur-xl bg-white/5 shadow-2xl
            ${result.prediction === "phishing" ? "border-red-500/50" : "border-emerald-400/50"}`}
          >
            {/* Title */}
            <h2
              className={`text-2xl font-bold mb-3 ${
                result.prediction === "phishing"
                  ? "text-red-400"
                  : "text-emerald-400"
              }`}
            >
              {result.prediction === "phishing" ? "⚠️ PHISHING URL" : "✅ SAFE URL"}
            </h2>

            {/* URL */}
            <p className="text-slate-300 break-all mb-2">{result.url}</p>

            {/* RISK LEVEL */}
            <p className="text-slate-400 mb-1">
              Risk Level: <span className="font-semibold">{getRiskLevel()}</span>
            </p>

            {/* CONFIDENCE */}
            <p className="text-slate-400 mt-2 mb-1">
              Confidence: <strong>{getConfidence().toFixed(2)}%</strong>
            </p>

            {/* CONFIDENCE BAR */}
            <div className="w-full h-2 bg-slate-800 rounded-full overflow-hidden">
              <div
                className={`h-full ${
                  result.prediction === "phishing"
                    ? "bg-red-500"
                    : "bg-emerald-400"
                }`}
                style={{ width: `${getConfidence()}%` }}
              />
            </div>
          </motion.div>
        )}

      </div>
    </div>
  );
}

export default App;
